import React, { useState, useEffect } from 'react';

export default function Profile(props) {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [path1, setPath1] = useState([]);
    const [path2, setPath2] = useState([]);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetch(`http://localhost:5500/info?username=${props.user}`);
                if (!response.ok) {
                    throw new Error('Failed to fetch user data');
                }
                const data = await response.json();
                setName(data.name);
                setEmail(data.email);
                setPath1(data.path1 || []);
                setPath2(data.path2 || []);
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        };
        fetchUserData();
    }, [props.user]);

    return (
        <div className="container mt-5">
            <div className="row" style={{ marginTop: "80px", marginBottom: "20px" }}>
                <div className="col-md-4">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">{name.toUpperCase()}</h5>
                            <button className='btn btn-dark' onClick={props.loggedout} style={{ backgroundColor: "#FFA07A", color: "#242424", borderColor: "white" }}>LogOut</button>
                        </div>
                    </div>
                </div>
                <div className="col-md-8">
                    <div className="card">
                        <div className="card-body">
                            <h5 className="card-title">Profile Information</h5>
                            <ul className="list-group list-group-flush">
                                <li className="list-group-item"><strong>Name : </strong> {name}</li>
                                <li className="list-group-item"><strong>Email : </strong> {email}</li>
                            </ul>
                        </div>
                    </div>
                    <div className="card mt-3">
                        <div className="card-body">
                            <div id="accordionExample" className="accordion">
                                <div className="accordion-item">
                                    <h2 className="accordion-header">
                                        <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne">
                                            StyleTransfer Activity
                                        </button>
                                    </h2>
                                    <div id="collapseOne" className="accordion-collapse collapse show" data-bs-parent="#accordionExample">
                                        <div className="accordion-body" style={{ display: "flex", justifyContent: "space-between", flexWrap: "wrap" }}>
                                            <div className="image-gallery" style={{ display: "flex", justifyContent: "space-around", flexWrap: "wrap" }}>
                                                {path1.map((path, index) => (
                                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginTop: "10px", marginBottom: "5px" }} />
                                                ))}
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div id="accordionExample2" className="accordion">
                                <div className="accordion-item">
                                    <h2 className="accordion-header">
                                        <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseTwo" aria-expanded="true" aria-controls="collapseTwo">
                                            DeepDream Activity
                                        </button>
                                    </h2>
                                    <div id="collapseTwo" className="accordion-collapse collapse show" data-bs-parent="#accordionExample2">
                                        <div className="accordion-body">
                                            <div className="image-gallery" >
                                                {path2.map((path, index) => (
                                                    <img key={index} src={`http://localhost:5500/${path}`} alt="" style={{ height: "200px", width: "200px", marginTop: "10px", marginBottom: "5px" }} />
                                                ))}
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
